import React, {useState} from 'react';

function AddUser() {
    const [counter, setCounter] = useState(0)

    // const  increase = function () {
    //     setCounter(counter + 1)
    // }

    return (
        <div>
            <p>Counter: {counter}</p>
            <button onClick={() => {
                setCounter(counter + 1)
            }}>Increase</button>

        </div>
    );
}

export default AddUser;
